(58, 1, '2022-10-10 10:14:57', '2022-10-10 10:14:57', '<table class=\"a-normal a-spacing-micro\">\r\n<tbody>\r\n<tr class=\"a-spacing-small po-brand\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Brand</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Samsung</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-model_name\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Model Name</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Samsung Galaxy S22 Ultra 5G</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-wireless_provider\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Network Service Provider</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Unlocked for All Carriers</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-operating_system\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">OS</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Android 12</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-cellular_technology\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Cellular Technology</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">5G</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n 	<li><span class=\"a-list-item\">The first Galaxy S with embedded S Pen. Write comfortably like pen on paper, turn quick notes into legible text and use Air Actions to control your phone remotely. Improved latency in Samsung Notes makes every pen stroke feel as natural as ink on paper — and you can convert those hastily written ideas into legible text.</span></li>\r\n 	<li><span class=\"a-list-item\">5G Ready powered by Galaxy’s first 4nm processor. Our fastest, most powerful chip ever. That means, a faster CPU and GPU compared to Galaxy S21 Ultra. It’s an epic leap for smartphone technology.</span></li>\r\n 	<li><span class=\"a-list-item\">The Dynamic AMOLED 2x display improves outdoor visibility with up to 1750 nits in peak brightness.* And the 120Hz adaptive refresh rate keeps the scroll smooth, adjusting to what\'s on screen for an optimized view.</span></li>\r\n 	<li><span class=\"a-list-item\">Our most advanced Pro-grade Camera yet, packing the power of a professional\'s kit in one handheld device. Also lets you make your nights epic with Nightography: The sensor pulls in more light, the Super Clear Lens tones down lens flare, and fast-acting AI delivers near-instant intelligent processing.</span></li>\r\n 	<li><span class=\"a-list-item\">Connector type: usb type c</span></li>\r\n</ul>', 'Samsung Galaxy S22 Ultra 5G (Phantom Black, 12GB, 256GB Storage)', '', 'publish', 'open', 'closed', '', 'samsung-galaxy-s22-ultra-5g-phantom-black-12gb-256gb-storage', '', '', '2022-10-10 10:15:01', '2022-10-10 10:15:01', '', 0, 'http://localhost/Digital_Store/?post_type=product&#038;p=58', 0, 'product', '', 0),
