inst dangerous airborne contaminants.</span></li>\r\n 	<li><span class=\"a-list-item\">Warranty : 1 Year on Product, 10 Years on Compressor</span></li>\r\n 	<li><span class=\"a-list-item\">Product Dimensions &amp; Weight : IDU - 82 cm X 29.9 cm X 21.5 cm (w x h x d), Outdoor : 72 cm X 54.8 cm X 26.5 cm (w x h x d), IDU : 9.3 Kg, Outdoor : 28.5 Kg</span></li>\r\n 	<li><span class=\"a-list-item\">Included In The Box: 1 Indoor Unit, 1 Outdoor Unit, Inter Connecting Pipe, 1 Remote controller, 1 User Manual With Warranty Card, 2 AAA Batteries for Remote Controller</span></li>\r\n</ul>', 'Samsung 1.5 Ton 3 Star Inverter Split AC (Copper, Convertible 5-in-1 Cooling Mode, Anti-Bacteria Filter, 2022 Model, AR18BYLZAUR, White)', '', 'publish', 'open', 'closed', '', 'samsung-1-5-ton-3-star-inverter-split-ac-copper-convertible-5-in-1-cooling-mode-anti-bacteria-filter-2022-model-ar18bylzaur-white', '', '', '2022-10-10 16:29:34', '2022-10-10 16:29:34', '', 0, 'http://localhost/Digital_Store/?post_type=product&#038;p=184', 0, 'product', '', 0),
