lass=\"a-spacing-small po-maximum_rotational_speed\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Maximum Rotational Speed</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">700 RPM</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-access_location\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Access Location</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Top Load</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n 	<li><span class=\"a-list-item\">Fully-automatic top load washing machine: Affordable with great wash quality, Easy to use</span></li>\r\n 	<li><span class=\"a-list-item\">5 Star Energy Rated Model : Best in class efficiency</span></li>\r\n 	<li><span class=\"a-list-item\">Capacity 6.5 Kg : Suitable for bachelors &amp; couples</span></li>\r\n 	<li><span class=\"a-list-item\">Manufacturer Warranty: 2 years on product and 10 years on motor*T&amp;C</span></li>\r\n 	<li><span class=\"a-list-item\">700 RPM: Higher spin speeds helps in faster drying</span></li>\r\n 	<li><span class=\"a-list-item\">Wash Programs: Normal, Pre Wash+Normal, Gentle (Wool/Saree), Quick Wash, Strong (Jeans), Tub Clean/Aqua reserve</span></li>\r\n 	<li><span class=\"a-list-item\">Also included in the box: 1 Washing Machine, 1 Anti Rat cover, 1 Owner’s manual,OT Hose,Drain Hose,QRG,Detergent Powder(200gm Packet)</span></li>\r\n 	<li><span class=\"a-list-item\">Spl. Feature: Smart Inverter Technology: an energy saving technology and it’s revolutionary water proof motor doesn\'t corrode and is the most durable one in its league | TurboDrum | Tub Clean : To sterilize the inner and outer tub for preventing unpleasant smell of tub | Smart Cleaning | Child Lock | Smart Diagnosis | Normal Pulsator | 3-Step Wash | Fuzzy Logic Control | Stainless Steel Inner Tub | Cold Water inlet | Memory Backup | Auto Balance System | Window(Glass Type):Transparent | Auto Restart| Standby Power Save</span></li>\r\n</ul>', 'LG 6.5 Kg 5 Star Smart Inverter Fully-Automatic Top Loading Washing Machine (T65SKSF4Z, Middle Free Silver)', '', 'publish', 'open', 'closed', '', 'lg-6-5-kg-5-star-smart-inverter-fully-automatic-top-loading-washing-machine-t65sksf4z-middle-free-silver', '', '', '2022-10-10 17:05:21', '2022-10-10 17:05:21', '', 0, 'http://localhost/Digital_Store/?post_type=product&#038;p=211', 0, 'product', '', 0),
