base a-text-bold\">Maximum Rotational Speed</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">1200 RPM</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-item_weight\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Item Weight</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">62000 Grams</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-included_components\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Included Components</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">‎1 unit of machine, 1 unit of drain hose, 1 unit OT hose, 1 unit of QRG, 1 unit of user manual</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n 	<li><span class=\"a-list-item\">Fully-automatic front load washing machine: best wash quality, energy and water efficient</span></li>\r\n 	<li><span class=\"a-list-item\">Capacity 7 kg: Suitable for 3 – 4 members</span></li>\r\n 	<li><span class=\"a-list-item\">Energy Rating 5 Star: Best in class efficiency</span></li>\r\n 	<li><span class=\"a-list-item\">Manufacturer Warranty: 2 years on product, 10 years on motor (T&amp;C)</span></li>\r\n 	<li><span class=\"a-list-item\">1200 RPM: higher spin speeds helps in faster drying</span></li>\r\n 	<li><span class=\"a-list-item\">10 Wash Programs: Cotton, Cotton Large, Mix, Easy Care, Baby Care, Sports Wear, Delicate, Wool, Quick30, Rinse plus Spin</span></li>\r\n 	<li><span class=\"a-list-item\">With LG Inverter Direct Drive Technology, the motor is directly connected to the drum without the use of a belt or pulley. which cuts down electricity consumption, enhances washing performance and durability, and reduces noise and vibration</span></li>\r\n</ul>\r\n<div class=\"a-row a-expander-container a-expander-inline-container\">\r\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\">\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n 	<li><span class=\"a-list-item\">Key Features: 6 Motion DD technology provides optimized motion combinations for each fabric type, Auto Restart with Memory Backup, Tub Clean, Fault Diagnosis (digital display), Steam wash: Remove allergens, Touch Panel</span></li>\r\n 	<li><span class=\"a-list-item\">Special Features: Temperature Range - Cold/20/30/40/60/95 degree Celsius, Remaining Time Delay/Display, Fuzzy Logic, Baby care, Intensive wash, Child Lock, Jog Dial for Program Selection, 170 Degree Door Opening Angle, 300 MM Door Diameter</span></li>\r\n 	<li><span class=\"a-list-item\">Included In The Box: ‎‎1 unit of machine, 1 unit of drain hose, 1 unit OT hose, 1 unit of QRG, 1 unit of user manual</span></li>\r\n</ul>\r\n</div>\r\n</div>', 'LG 7 Kg 5 Star Inverter Touch Control Fully-Automatic Front Load Washing Machine with Heater (FHM1207SDL, Silver, 6 Motion Direct Drive)', '', 'publish', 'open', 'closed', '', 'lg-7-kg-5-star-inverter-touch-control-fully-automatic-front-load-washing-machine-with-heater-fhm1207sdl-silver-6-motion-direct-drive', '', '', '2022-10-10 16:46:48', '2022-10-10 16:46:48', '', 0, 'http://localhost/Digital_Store/?post_type=product&#038;p=221', 0, 'product', '', 0),
