s,Everyday fresh-Easy slide tray, Anti Bacterial Filters</span></li>\r\n</ul>\r\n</div>\r\n<i class=\"a-icon a-icon-extender-collapse\"></i></div>\r\n</div>\r\n</div>', 'Whirlpool 265 L 2 Star Frost-Free Double Door Refrigerator (NEOFRESH GD PRM 278 2S, Crystal Black, Glass Door)', '', 'publish', 'open', 'closed', '', 'whirlpool-265-l-2-star-frost-free-double-door-refrigerator-neofresh-gd-prm-278-2s-crystal-black-glass-door', '', '', '2022-10-10 17:27:52', '2022-10-10 17:27:52', '', 0, 'http://localhost/Digital_Store/?post_type=product&#038;p=332', 0, 'product', '', 0),
