(346, 1, '2022-10-10 17:32:09', '2022-10-10 17:32:09', '<div id=\"productOverview_feature_div\" class=\"celwidget\" data-feature-name=\"productOverview\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"productOverview\" data-csa-c-slot-id=\"productOverview_feature_div\" data-csa-c-asin=\"B088287VHS\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"jbijy4-i24ck5-uhcdle-9id3ac\" data-cel-widget=\"productOverview_feature_div\">\r\n<div class=\"a-section a-spacing-small a-spacing-top-small\">\r\n<table class=\"a-normal a-spacing-micro\">\r\n<tbody>\r\n<tr class=\"a-spacing-small po-brand\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">rand</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Whirlpool</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-capacity\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Capacity</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">200 litres</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-configuration\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Configuration</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Freezer-on-Top</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-energy_star\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Energy Star</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">4 Star</span></td>\r\n</tr>\r\n<tr class=\"a-spacing-small po-color\">\r\n<td class=\"a-span3\"><span class=\"a-size-base a-text-bold\">Colour</span></td>\r\n<td class=\"a-span9\"><span class=\"a-size-base\">Wine Flume</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div id=\"featurebullets_feature_div\" class=\"celwidget\" data-feature-name=\"featurebullets\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"featurebullets\" data-csa-c-slot-id=\"featurebullets_feature_div\" data-csa-c-asin=\"B088287VHS\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"mqygg2-t92955-std0hs-nwhxsg\" data-cel-widget=\"featurebullets_feature_div\">\r\n<div id=\"feature-bullets\" class=\"a-section a-spacing-medium a-spacing-top-small\">\r\n\r\n<hr />\r\n\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n 	<li><span class=\"a-list-item\">Direct-cool refrigerator with modern curved design: 200 L with 4S Energy rating</span></li>\r\n 	<li><span class=\"a-list-item\">Modern door design with metallic handle, curved edges and Floral pattern finish to compliment your house</span></li>\r\n 	<li><span class=\"a-list-item\">IntelliSense Inverter Technology, with energy efficient inverter compressors</span></li>\r\n 	<li><span class=\"a-list-item\">No. 1 in Ice Making with Insulated Capillary Technology &amp; Laminar Airflow for efficient Cooling</span></li>\r\n 	<li><span class=\"a-list-item\">Preserves milk for upto 12 hours (in case of power cuts)</span></li>\r\n 	<li><span class=\"a-list-item\">Upto 7 days of Garden freshness with Honeycomb lock in that maintains optimum moisture in your vegetables</span></li>\r\n 	<li><span class=\"a-list-item\">Shelf type: Spill proof toughened glass</span></li>\r\n 	<li><span class=\"a-list-item\">Special Features: Jumbo storage (Upto four 2L bottles and five 1L bottles), Stabilizer free operations, Easy Defrosting, Quick chill zone, Large vegetable crisper, Insulated Capillary Technology, Anti bacterial gasket</span></li>\r\n</ul>\r\n</div>\r\n</div>', 'Whirlpool 200 L 4 Star Inverter Direct-Cool Single Door Refrigerator with Intellisense inverter technology(215 ICEMAGIC PRO PRM 4S INV, Wine Flume)', '', 'publish', 'open', 'closed', '', 'whirlpool-200-l-4-star-inverter-direct-cool-single-door-refrigerator-with-intellisense-inverter-technology215-icemagic-pro-prm-4s-inv-wine-flume', '', '', '2022-10-10 17:32:13', '2022-10-10 17:32:13', '', 0, 'http://localhost/Digital_Store/?post_type=product&#038;p=346', 0, 'product', '', 0);
