F\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"165bty-xk7l5w-yqlon1-5m3gh1\" data-cel-widget=\"featurebullets_feature_div\">\r\n<div id=\"feature-bullets\" class=\"a-section a-spacing-medium a-spacing-top-small\">\r\n\r\n<hr />\r\n\r\n<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n 	<li><span class=\"a-list-item\">Enjoy the sound of silence. With the same click feel and over 90% noise reduction on the click sound, enjoy a quiet experience for yourself and those around you. Plus, it has feet made of high performance material and a rubber wheel for quiet gliding and scrolling.</span></li>\r\n 	<li><span class=\"a-list-item\">Enjoy a wireless connection up to 33 feet (10m) away* thanks to a plug-and-forget nano receiver. M221 SILENT features Logitech Advanced Optical Tracking for ultra precise moves on almost any surface. No hassle, no software needed. Works with Windows, Mac, Chrome OS or Linux-based computers. *Actual wireless range may vary based on use, settings, and environmental conditions.</span></li>\r\n 	<li><span class=\"a-list-item\">With 18-month of battery, you can go longer between battery changes thanks to energy efficient engineering. Plus, M221 SILENT automatically puts itself to sleep when not in use. *Battery life may vary based on user and computing conditions.</span></li>\r\n 	<li><span class=\"a-list-item\">Ambidextrous design offers more comfort and precision than your touchpad. Its small size is perfect to toss in a bag and go.</span></li>\r\n</ul>\r\n</div>\r\n</div>', 'Logitech M221 Wireless Mouse, Silent Buttons, 2.4 GHz with USB Mini Receiver, 1000 DPI Optical Tracking, 18-Month Battery Life, Ambidextrous PC/Mac/Laptop - Charcoal Grey', '', 'publish', 'open', 'closed', '', 'logitech-m221-wireless-mouse-silent-buttons-2-4-ghz-with-usb-mini-receiver-1000-dpi-optical-tracking-18-month-battery-life-ambidextrous-pc-mac-laptop-charcoal-grey', '', ''